import './App.css';

function App() {
  return (
    <div>
      <h1>LOGIN</h1>
      <p>User Name</p>
      <input type="text"></input>
      <p>Password</p>
      <input type="password"></input>
      <button type="submit">Login</button>
    </div>
  );
}

export default App;
